class Solution {
public:
    int largest1BorderedSquare(vector<vector<int>>& grid) {
        int r = grid.size();
        int c = grid[0].size();
        vector<vector<pair<int,int>>> dp(r+1, vector<pair<int,int>>(c+1,{0,0}));

        int mx = 0;

        for(int i=1;i<=r;i++){
            for(int j=1;j<=c;j++){
                if(grid[i-1][j-1]!=0){

                    dp[i][j].first = dp[i-1][j].first+1;
                    dp[i][j].second = dp[i][j-1].second+1;

                    int sz = min(dp[i][j].first, dp[i][j].second);
                    while(sz>mx){
                        int p = min(dp[i-sz+1][j].second,dp[i][j-sz+1].first);
                        if(p>=sz)
                            mx = max(mx,sz);
                        sz++;
                    }
                }
            }
        }

        return mx*mx;
    }
};
```

